import { useLocation } from 'react-router-dom';

function Dashboard() {
  const { state } = useLocation();
  const {marks, message, result} = state;
  return (
    <div>
      <h2>This is dashboard</h2>
      {console.log(marks)}
    </div>
    
  )
}

export default Dashboard
